import React from 'react';

const TableDetails = ({ config, onClose }) => {
  if (!config) return null;

  return (
    <div className="modal">
        <div className="modal-content">
            <h2>Details</h2>
            <p>Name: {config.name}</p>
            <p>Description: {config.description}</p>
            <p>File: {config.file_name}</p>
            <p>Columns: {config.columns}</p>
            <div>
                {config.columns.map((column, index) => (
                    <p key={index}>{index}{column}</p>
                ))}
            </div>
            <p>Model Type: {config.model_type_id}</p>
            <p>Hyper parameters: {config.hyper_parameters}</p>
            <p>Created Date: {config.created_date}</p>
            <button onClick={onClose}>Close</button>
        </div>
    </div>
  );
};

export default TableDetails;
